import NavbarComponent from "./components/NavbarComponent";
import {BrowserRouter ,Route ,Link,Routes} from 'react-router-dom'
import HomeScreen from "./screens/HomeScreen";
function App() {
  return (
    <div className="App">
      <NavbarComponent/>
      <BrowserRouter>
        <Routes>
         <Route path="/home" exact component={HomeScreen}/>
        </Routes>

      </BrowserRouter>
    </div>
  );
}

export default App;
